import React from 'react';

// index.jsx
class SQLHandler extends React.Component {
    onClick() {
        fetch("http://your-php-server/ping-pong.php")
            .then(res => res.json())
            .then((result) => {
                console.log(result);
            })
    }

    render() {
        return (
            <button onClick={this.onClick}/>
        );
    }
}

export default function SQLDisplay() {

    return SQLHandler.render();

}
